import favouritesState from '../../zustand/favouritesState'
import Card from '../Card/Card'

export default function MyFavourites({onClose}) {

const favourites = favouritesState((state) => (state.favourites))
const removeFav = favouritesState((state) => (state.removeFav))

  return <div>
         
           {favourites.map((character) => <Card 
            id={character.id}
            name={character.name}
            status={character.status}
            species={character.species}
            gender={character.gender}
            origin={character.origin}
            image={character.image}
            onClose={(id) => removeFav(id)}></Card>)}
        
  </div>  
}
